css:
.deprecation-cop {
  overflow: auto;
  -webkit-flex: 1;
  background-color: #272822 !important;
}
.deprecation-cop .deprecation-info {
  padding: 0 10px;
}
.deprecation-cop .deprecation-info:hover {
  background-color: #1e1e1e !important;
}
.deprecation-cop .collapsed > ul {
  display: none;
}
.deprecation-cop .list {
  list-style-type: none;
  padding: 0;
}
.deprecation-cop .stack-trace {
  background-color: #1e1e1e;
  padding: 10px;
  margin-bottom: 10px;
}
.deprecation-cop a {
  color: #f5f4f1;
}
